import Layout from './Layout';
import ReactHLS from 'react-hls-player';

let myUrl = window.location.search.toString;

class Player extends React.Component {
    constructor(props) {
        super(props);
        this.getChannel = this.getChannel.bind(this);
    }

    getChannel = item => {
        
        let channelName = '';
        for(let i = 9; i < myUrl.length; i++) {
            channelName += 'a';
        }
        return channelName;
    }

    render(){
        return (
            <Layout>
                <p>{this.getChannel}</p>
            </Layout>
        )
    }
}

export default Player;
